import React, {useState} from 'react';
import {Nav, Navbar, Row, NavDropdown, Container, Button} from "react-bootstrap";
import Calendar from "./CalendarFolder/Calendar";
import FilterItem from "./filterItem";

const Filter = () => {
    const [light, setLight] = useState('light')
    const changeLight = ()=>{
        if (light == 'light'){
            setLight('dark');
        }else {
            setLight('light')
        }

    }
    return (
        <Row className={'filter'}>
            <Navbar variant={light} bg={light} expand="lg">
                <Container fluid>
                    <FilterItem component={<Calendar/>}/>
                    <Navbar.Collapse>
                        <Nav>
                            <NavDropdown
                                id=""
                                title="Страна"
                                menuVariant={light}
                                size={'400px'}
                            >

                            </NavDropdown>
                        </Nav>
                        <Nav>
                            <NavDropdown
                                id=""
                                title="Категория"
                                menuVariant={light}
                            >
                                <NavDropdown.Item onClick={()=>{changeLight()}}>Action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>

        </Row>

    );
};

export default Filter;
